import React from "react";

export default function Header() {
  return (
    <div
      style={{
        backgroundColor: "#0a2a66",
        color: "white",
        padding: "8px 20px",
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        fontFamily: "Arial, sans-serif",
      }}
    >
      {/* Logo */}
      <div style={{ display: "flex", alignItems: "center", gap: "10px" }}>
        <img src="/your-logo.png" alt="Logo" style={{ height: "40px" }} />
        <span style={{ fontSize: "20px", fontWeight: "bold" }}>YOUR BRAND</span>
      </div>

      {/* Nav Links */}
      <div style={{ display: "flex", gap: "20px", fontSize: "14px" }}>
        <div style={{ cursor: "pointer" }}>Services â–¼</div>
        <div style={{ cursor: "pointer" }}>Blog</div>
        <div style={{ cursor: "pointer" }}>How to book</div>
      </div>

      {/* Right Section */}
      <div style={{ display: "flex", gap: "15px", alignItems: "center" }}>
        <div style={{ cursor: "pointer" }}>Login</div>
        <div
          style={{
            cursor: "pointer",
            backgroundColor: "red",
            padding: "6px 12px",
            borderRadius: "4px",
            color: "white",
          }}
        >
          Contact Us
        </div>
        <div style={{ cursor: "pointer" }}>Cart (0)</div>
      </div>
    </div>
  );
}
